import React from 'react'

export default function PokedexList(props) {
    const pokemons = props.pokemons
   console.log(pokemons)
  return (

    <div>
      {pokemons.map((pokemon) => (
        <h2 key={pokemon.id}>{pokemon.name}</h2>
      ))}
    </div>
  )
}
